import Link from "next/link";
import React, { Component } from "react";
import Category_item from "./Category_item";
import "../../scss/category_items.scss";
import { connect } from "react-redux";
import { fetch_songs_popular } from "../../actions/songs_popular_Action";
class Category_items extends React.Component {
  componentDidMount() {
    this.props.fetch_songs_popular();
  }

  render() {
    return (
      <div className="to_grid">
        <Category_item />
      </div>
    );
  }
}

const mapStateToProps = stat => ({
  songs: state.songs_popular.items
});

export default connect(mapStateToProps, { fetch_songs_popular })(
  Category_items
);
